	public static void filterField(){
		List<String> strs = Arrays.asList("b0102_31","sbr","b0102_38","b0102_51","b0102_43","b0102_46","b0102_100","b0102_103","b0102_106","b0102_108","b0102_111","b0102_115","b0102_235","b0102_117","b0102_200","sbsj","b0102_06","b0102_03","b0102_04","b0102_261","b0102_260","b0102_262","b0102_145","b0102_148","sbdw","b0102_151","b0102_154","b0102_157","b0102_120","b0102_240","b0102_245","b0102_123","b0102_126","b0102_246","b0102_129","personid","b0102_132","b0102_135","b0102_137","b0102_258","b0102_139","b0102_77","b0102_73","b0102_65","b0102_194","b0102_197","b0102_69","b0102_61","b0102_97","b0102_93","b0102_95","b0102_176","b0102_179","b0102_80");
		strs.sort(new Comparator<String>() {
			@Override
			public int compare(String o1, String o2) {
				if(o1.indexOf("_") > 0 && o2.indexOf("_") > 0){
					int i1 = Integer.parseInt(o1.substring(o1.lastIndexOf("_")+1));
					int i2 = Integer.parseInt(o2.substring(o2.lastIndexOf("_")+1));
					return i1 - i2;
				}
				return o1.compareTo(o2);
			}
		});
		System.out.println(JSONArray.toJSONString(strs));
	}
	
